INSERT INTO `recipes` VALUES (1,'Socna gibanica','Promešajte jaja, jogurt, vodu, ulja i so u jednoličnu masu. Prvo malo izmutite jaja, pa onda dodajte ostalo. Raširi se jedna kora na radni sto i poprska se ravnomerno sa malo sitnog sira. Preko ove se stavi druga kora i opet se poprska sa malo sitnog sira, pa treća i sve tako dok se kore i sir ne potroše. Znači, sve kore jedna preko druge.\r\n\r\nOnda se uviju u rolat i podele sa malim zasecima na deset jednakih delova. Onda se oštrim nožem iseku parčići. Kako isečete parče, tako ga stavite u pleh, sa sirom stranom prema dole. Podgrejte sve parčiće jedan do drugoga u dva reda, ako je pleh dugačak. Ako je okrugli, onda ređajte naokolo i završavate u sredini.\r\n\r\nDobro prelijte rolate sa prelivom, tako da svaki istu količinu preliva. Pecite oko 40 minuta u prethodno zagrejanoj rerni na 200 stepeni.',15,40,6,_binary 'RIFF,A\0\0WEBPVP8X\n\0\0\0\0\0\0\0c\0VP8 \=\0\0t*d>u6G*%)3@en\7cXqϰ1oi\\O\oMn4sr}f\?\\^w<\7췩-M\H\\\.W2^QT\\\wCGޖ~\,S)\e2le2LSϔ>\\B\\b5&!7j+9\Z6Z\\q82P\\Sv&dT\ې\ÿ?\[\oɇ\b_^ࠞW\Y᡼Ni\"^{\n]\\05\۳\2s\SqC?H\Ӈ\n?[\2^p\\*\/,\\^._JB\y?gx$U䒚u7}_Һr\!-S\`|hZr;t#WǇ\Z+7<%1NxOm:\N`\V\1h9\\\\\\\3@\n\F\Z=ȓ\6\#\Z\\\63\,%Sa\b\\V\v\\+8\sm\H\Op\\MӬ_#:\r]~{xZJ\Zk\Faj6gck6\G|\'{ԂJ\˗{S\\#$Aܾ\P4\ގ9(\]\%ߛHa\\\S/-\O\H,e\4\\Nc\lcY8iJ\\΢Zp\\컥?s>o\$[;XLo}\TVU\3\ympɼb \g/\ey\w,&d\\Z\RN<K͵̜6\\N9\~l?ѷ\\i`*%J\8\:\W+|=I4\M\c\"qW\\ř\4\#Қt`H\\Y\nl\,׈\\!7*UQ`$\eH\K2|\\\ѧ\\[nJP\I\'kLqǵ\Zl1dK7\0,	A_D\(g\\\Eso\"\031Cj`\S\)\a\\ָӡ_\:{\nU\\\Ʋg\L\z{\EMm{Vg\r4J~icV+.\+\\0*cx>,XǗ\1p\iz4$$*\n<?׭Hk/\!y\{.\lG+ٳ4i^a\pg&\P\r]]IMH7\,ů\"*!!W_y$H$byK\G\BnĘ\\\D6)(\yr\њw懤4\q\h6i\R\\n\\\eL\-;JQ^\Q G\beOZ$ϊsHF \\\AJo\v\Cb0G$\q6D\".E\@Q(\\ZU HZH\;\\L\x3۬-v=YysCރГ\ڱ\y骬k\\K\_\\Ty]\\E|^\lA\r\\\&\\1>F谴\9)\\\.v\0\\ڂ\\\^U1@\(L\ILqihQQNK\T\\\%Ԛ	͝N\1E%K+\"\\*;o/r5`.\'>\{\HԖ7\0\\q\w!\\keY\nw$\m~\	r\k{n3,}h\'P:&x)Գ~*\